import React from "react";

const CardHorizontal = props => (
  <article>
    <div className="card">
      <img src={props.image} />
      <div className="contents">
        <h3>{props.title}</h3>
      </div>
    </div>

    <style jsx>{`
      h3 {
        margin: 0;
      }

      .contents {
        padding-left: 16px;
      }

      img {
        width: 100%;
        margin-bottom: 10px;
      }
    `}</style>
  </article>
);

export default CardHorizontal;
